    hMem   = GUI_MEMDEV_CreateEx((xSize - _bmCar.XSize) / 2, (ySize - _bmCar.YSize) / 2 + 10, _bmCar.XSize, _bmCar.YSize, GUI_MEMDEV_NOTRANS);
